import React, { useState } from 'react'

const Piece = props => {
    const [currX, setCurrX] = useState(props.x);
    const [currY, setCurrY] = useState(props.y);

    let x = currX * 100;
    let y = currY * 100;

    return (
        <div style={{position:'absolute', left:{x}, top:{y}, backgroundColor:'red'}}>
            Piece
        </div>
    )
}

export default Piece;
